import Header from './components/Header'
import './App.css';
import Sidebar from "./components/Sidebar";
import Home from "./page/Home";
import DashboardContextProvider from '../src/dashboardContext'



function App() {
  return (

        <div className="App">
            <Header/>
            <main className="main">
                <Sidebar />
                <DashboardContextProvider>
                    {children}
                    <Home/>
                </DashboardContextProvider>
            </main>


        </div>


  );
}

export default App;
